import React from 'react';

const Navbar = () => {
  return (
    <nav>
      <div className="logo">
        <img src='/images/logo.png' alt=" Logo" width="192" height="92" />
        <h1>Restaurant App</h1>
      </div>
      <ul className="nav-links">
        <li><a href="#">Home</a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Contact</a></li>
      </ul>
    </nav>
  );
};

export default Navbar;
